{'content': 'Написать новость своими словами, чтобы текст получился уникальным: Консультант компании OceanGate Expeditions, владеющей пропавшим батискафом в северной части Атлантического океана, отказался от поездки на последнем этапе из-за срочных дел, сообщает Sky News. Дэвид Конкэннон сразу же согласился помочь в спасательных операциях. Поиск батискафа, который исчез во время экспедиции к обломкам «Титаника», начался примерно в 900 милях от мыса Кейп-Код на атлантическом побережье США. На место происшествия направлены самолеты США и Канады.

В понедельник OceanGate Expeditions подтвердила пропажу своего батискафа с экипажем, который должен был доставить туристов к месту крушения «Титаника». Связь с пятью членами экипажа прервалась примерно через 1 час 45 минут после погружения в воскресенье. На батискафе есть запас воздуха на четыре дня.

Представитель береговой охраны подтвердил, что на батискафе находятся пять человек. Sky News сообщает, что среди них могут быть британский миллиардер Хамиш Хардинг, французский ветеран глубоководных исследований Поль-Анри Наржеоле и основатель компании OceanGate Expeditions Стоктон Раш. Irish Sun пишет, что ирландский исследователь Рори Голден, один из членов экипажа батискафа, связался с ними и написал в социальной сети, что с ним все в порядке.', 'role': 'user'}
